import React, { Component } from 'react'
import { Link, Redirect, withRouter, NavLink } from "react-router-dom";
import "./Test.css";
import axios from "axios";
import authService from "../../services/auth-service";
import axiosService from "../../services/axios-service";
import { API_URL } from "../../services/url";
import SimpleReactValidator from "simple-react-validator";
import { SuccessModal } from './SuccessModal';
export class AT1 extends Component {
    constructor(props) {
        super(props);
        this.state = {

          btnstatus : false,
          location: "",
          issued_by: "",
          related_process: "",
          issued_to: "",
          pto_comment: "",
          testing_quantity: "",
          plant: localStorage.getItem("plant_name"),
          date: "",
          s_r1: "",
          s_r2: "",
          s_r3: "",
          s_r4: "",
          s_r5: "",
          s_r6: "",
          s_r7: "",
          s_r8: "",
          s_r9: "",
          s_t1 : "",
          s_t2 : "",
          s_t3 : "",
          s_t4 : "",
          s_t5 : "",
          s_t6 : "",
          s_t7 : "",
          s_t8 : "",
          s_t9 : "",
          s_t10 : "",
          s_t11 : "",
          s_t12 : "",
          s_t13 : "",
          s_t14 : "",
          s_t15 : "",
          s_t16 : "",
          s_t17 : "",
          s_t18 : "",
          s_t19 : "",
          s_t20 : "",
          s_t21 : "",
          s_t22 : "",
          s_t23 : "",
          s_t24 : "",
          s_t25 : "",
          s_t26 : "",
          s_t27 : "",
          s_t28 : "",
          s_t29 : "",
          s_t30 : "",
          s_t31 : "",
          s_t32 : "",
          s_t33 : "",
          s_t34 : "",
          s_t35 : "",
          s_t36 : "",
          s_t37 : "",
          s_t38 : "",
          s_t39 : "",
          s_t40 : "",
          s_t41 : "",
          s_t42 : "",
          s_t43 : "",
          s_t44 : "",
          s_t45 : "",
          s_t46 : "",
          s_t47 : "",
          s_t48 : "",
          s_t49 : "",
          s_t50 : "",
          s_t51 : "",
          s_t52 : "",
          s_t53 : "",
          s_t54 : "",
          s_t55 : "",
          s_t56 : "",
          s_t57 : "",
          s_t58 : "",
          type: "AT_1",
        };
        this.onSubmit = this.onSubmit.bind(this);
        this.validator = new SimpleReactValidator();
      }
      componentWillMount = () => {
        var today = new Date();
        var dd = today.getDate();
        var mm = today.getMonth() + 1; //January is 0!
        var yyyy = today.getFullYear();

        if (dd < 10) {
          dd = "0" + dd;
        }

        if (mm < 10) {
          mm = "0" + mm;
        }

        today = mm + "/" + dd + "/" + yyyy;
        console.log("date here", today);
        this.state.date = today;
        console.log(this.state.date);

        //rf form demo
        for(let i=1;i<=25;i++)
        {
          console.log('result',i,': ','map.result',i)
        }
      };

      change = e => {
        this.setState({
          [e.target.name]: e.target.value
        });
      };
      getWebsite = () => {
        fetch("/").then(console.log(this.state));
      };
      openModal() {
        this.setState({
            visible : true
        });
    }

      closeModal() {
        this.setState({
            visible : false
        });
      }
      async onSubmit(event) {
        event.preventDefault();
        console.log(this.state);
        if (this.validator.allValid()) {
          let tokenvalue = localStorage.getItem("token");
          this.openModal();
          this.setState({
            btnstatus : true
          })
          try {
            const response = await axios.post(
              `${API_URL}rf_form/submit`,
              this.state,
              (axios.defaults.headers.common["x-access-token"] = tokenvalue)
            );
            console.log(response);
            //   .then(console.log(this.state));

              if (response.data==='success') {

                this.props.history.push("/ViewAT1");
                // alert(response.data);
              } else {
                alert(response.data);
              }
          } catch (error) {
            console.log(error);
          }
        } else {
          this.validator.showMessages();
          // rerender to show messages for the first time
          this.forceUpdate();
        }
      }
      // totalshow = e => {
      //   e.preventDefault();
      //   let total_sample_sieving = this.state.weight_sample_sieving;
      //   let total_sample_testing = this.state.weight_sample_testing;
      //   let total_amount =
      //     ((total_sample_testing - total_sample_sieving) / total_sample_testing) *
      //     100;
      //   this.state.total = total_amount;
      //   console.log(total_amount);
      //   this.setState({
      //     amount_status: true
      //   });
      // };
      render() {
             // let showmodal;
     let sbmtbtn, btnmsg;
     if(this.state.visible)
     {
       // showmodal = (
       //   <div>
       //     <SuccessModal  
       //          visible={this.state.visible}
       //               width={this.props.width}
       //               height={this.props.height}
       //               effect={this.props.effect}
       //               onClickAway={() => this.closeModal()} />
       //   </div>
       // )
     }
     if(this.state.btnstatus)
     {
       sbmtbtn = (
         <button
         class="btn btn-primary"
         onClick={this.onSubmit.bind(this)}
         disabled
       >
         Submit
       </button>
       )
       btnmsg = (
         <div>
         <hr />
         <p>Your Form Has Already Been Submitted.Please Don't Click SUMBIT Button AGAIN!!</p>
         </div>
       )
     }
     else
     {
       sbmtbtn=(
         <button
         class="btn btn-primary"
         onClick={this.onSubmit.bind(this)}
       >
         Submit
       </button>
       )
     }
        let display_total_amount;
        if (this.state.amount_status == true) {
          display_total_amount = <div>{this.state.total} %</div>;
        } else {
          display_total_amount = (
            <div>
              <p>Enter The Above Fields</p>
            </div>
          );
        }

        return (
          <div className="skin-blue fixed-layout">
            <div className="page-wrapper">
              <div className="container-fluid">
                <div className="row page-titles">
                  <div className="col-md-5 align-self-center">
                    {/* <h4 className="text-themecolor">Forms</h4> */}
                    <nav aria-label="breadcrumb">
                      <ol class="breadcrumb">
                        <li className="breadcrumb-item">
                          <Link to={process.env.PUBLIC_URL + "/"}>Home</Link>
                        </li>
                        <li className="breadcrumb-item active" aria-current="page">
                         AT 1
                        </li>
                      </ol>
                    </nav>
                  </div>
                </div>
              </div>

              {/*Form content begin */}

              <div className="product-form-upper">
                <div className="container-fluid">
                  <div className="below-custom-form">
                    <div className="row">
                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <div className="custom-btn-lists">
                          {/* <ul>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT1"}
                                >
                                 AT1
                                </NavLink>
                              </button>
                            </li>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT2"}
                                >
                                  AT2
                                </NavLink>
                              </button>
                            </li>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT3"}
                                >
                                  AT3
                                </NavLink>
                              </button>
                            </li>

                          </ul> */}
                        </div>

                        {/* <hr /> */}
                      </div>

                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <p style={{ textAlign: "center" }}>
                        <h3> AT - 01</h3>
                        </p>
                        <hr />
                      </div>
                      {/* <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <h3>Add Aggregate</h3>
                        <hr />
                        <br />
                      </div> */}
                    </div>
                    <form className="custom-content-form">
                      <div className="form-row">
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                             Location Name
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="location"
                                value={this.state.location}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                                {this.validator.message(
                                  "location's name",
                                  this.state.location,
                                   "required|alpha_space"
                                )}
                              </span>
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              date
                            </label>
                            <div class="col-sm-10">{this.state.date}</div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                             Issued By
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="issued_by"
                                value={this.state.issued_by}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                                {this.validator.message(
                                  "issued by",
                                  this.state.issued_by,
                                  "required|alpha_space"
                                )}
                              </span>
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Plant
                            </label>
                            <div class="col-sm-10">
                            {localStorage.getItem('plant_name')}
                              {/* <span className="text-danger">
                                {this.validator.message(
                                  "plant",
                                  this.state.plant,
                                  "required"
                                )}
                              </span> */}
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Related Process
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="related_process"
                                value={this.state.related_process}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                                {this.validator.message(
                                  "related process",
                                  this.state.related_process,
                                  "required|alpha_space"
                                )}
                              </span>
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputSubcategory"
                              className="col-sm-2 col-form-label"
                            >
                              Issued To
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="issued_to"
                                value={this.state.issued_to}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                                {this.validator.message(
                                  "issued to",
                                  this.state.issued_to,
                                  "required"
                                )}
                              </span>
                            </div>
                          </div>
